import React, { useState, useEffect} from 'react';
import axios from 'axios';


export default function TestFectch({}) {

    //const [data, setData] = useState([]);

    const url = "http://localhost:8800/catalogues"

    const [data, setData] = useState([])

    useEffect(() => {
      axios.get(url).then(json => setData(json.data))
    }, [])

  return (
    <ul>
      {data.map(item => (
          <>
        <li key={item.id}>
          <a href="#">{item.name}</a>
        </li>
        <div>

        </div>
        </>
      ))}
    </ul>
  );
}
